import React from "react";

class Car extends React.Component {
  constructor() {
    super();
    this.state = {
      brand: "Ford",
      model: "Mustang",
      color: "Red",
    };
  }
  render() {
    console.log(this.state);
    return (
      <>
        <h1>My{this.state.brand}</h1>
        <h1>My{this.state.model}</h1>
        <h1>My{this.state.color}</h1>
      </>
    );
  }
}
export default Car;
